'''梦咲枫（{{ruby|{{lj|夢咲}}|ゆめさき}} {{ruby|{{lj|楓}}|かえで}}）''' 是遊戲部企劃的四位虚拟YouTuber之一。

==简介==

形象由necömi設計。

遊戲部企劃成員之一的VTuber。

=== 设定 ===

小时候父母双忙，留守在家时便常玩游戏。

小学时观看过世界级游戏大赛后，便下定决心成为硬核玩家。双休日会花上10个小时打游戏。

初中曾参加了篮球部。由于参加某次游戏大会被淘汰，便由此契机，升入高中时在都内某高中建立了游戏部，并担任部长。

擅长的游戏是[[精灵宝可梦]]和[[影之诗]]。

